import React from "react";
import "./item.css"
import ItemCount from '../item-count/ItemCount'
import ItemList from "/";

function Item({ item }){
    return(
        <div id="div">
            <ItemList tituloPrincipal ="Productos"/>
            <ItemCount/>
        </div>        
        
    );
}

export default Item;
